import Tone from 'tone'

let synth1 = new Tone.PolySynth(1, Tone.Synth, {
  oscillator: {
    type: 'fatsawtooth',
    count: 3,
    spread: 30,
    phase: 10
  },
  envelope: {
    attack: 1,
    decay: 1,
    sustain: 1,
    release: 5,
    attackCurve: 'exponential'
  }
})

let synth2 = new Tone.PolySynth(1, Tone.Synth, {
  oscillator: {
    type: 'sine'
  },
  envelope: {
    attack: 0.3,
    decay: 1,
    sustain: 1,
    release: 5,
    attackCurve: 'exponential'
  }
})

let synth3 = new Tone.PolySynth(1, Tone.Synth, {
  oscillator: {
    type: 'square'
  },
  envelope: {
    attack: 0.3,
    decay: 0.1,
    sustain: 0.3,
    release: 1,
    attackCurve: 'exponential'
  }
})

let synth4 = new Tone.Synth({
  oscillator: {
    type: 'square'
  },
  envelope: {
    attack: 0.005,
    decay: 0.1,
    sustain: 0.3,
    release: 1
  }
})

export { synth1, synth2, synth3, synth4 }
